int Stream_template::size_of() const
{
  if (is_ifpresent) TTCN_error("Performing sizeof() operation on a template of type @http_etherx_jabber_org_streams.Stream which has an ifpresent attribute.");
  switch (template_selection)
  {
  case SPECIFIC_VALUE:
  {    int ret_val = 2;
      if (single_value->field_from__.is_present()) ret_val++;
      if (single_value->field_id.is_present()) ret_val++;
      if (single_value->field_lang.is_present()) ret_val++;
      if (single_value->field_to__.is_present()) ret_val++;
      if (single_value->field_version.is_present()) ret_val++;
      if (single_value->field_features.is_present()) ret_val++;
      if (single_value->field_elem.is_present()) ret_val++;
      if (single_value->field_elem__1.is_present()) ret_val++;
      if (single_value->field_choice.is_present()) ret_val++;
      if (single_value->field_error__.is_present()) ret_val++;
      return ret_val;
    }
  case VALUE_LIST:
   {
     if (value_list.n_values<1)
       TTCN_error("Internal error: Performing sizeof() operation on a template of type @http_etherx_jabber_org_streams.Stream containing an empty list.");
      int item_size = value_list.list_value[0].size_of();
      for (unsigned int l_idx = 1; l_idx < value_list.n_values; l_idx++)
      {
        if (value_list.list_value[l_idx].size_of()!=item_size)
          TTCN_error("Performing sizeof() operation on a template of type @http_etherx_jabber_org_streams.Stream containing a value list with different sizes.");
      }
      return item_size;
    }
  case OMIT_VALUE:
    TTCN_error("Performing sizeof() operation on a template of type @http_etherx_jabber_org_streams.Stream containing omit value.");
  case ANY_VALUE:
  case ANY_OR_OMIT:
    TTCN_error("Performing sizeof() operation on a template of type @http_etherx_jabber_org_streams.Stream containing */? value.");
  case COMPLEMENTED_LIST:
    TTCN_error("Performing sizeof() operation on a template of type @http_etherx_jabber_org_streams.Stream containing complemented list.");
  default:
    TTCN_error("Performing sizeof() operation on an uninitialized/unsupported template of type @http_etherx_jabber_org_streams.Stream.");
  }
  return 0;
}

