void Stream_choice_template::clean_up()
{
switch (template_selection) {
case SPECIFIC_VALUE:
switch (single_value.union_selection) {
case Stream_choice::ALT_choice__list:
delete single_value.field_choice__list;
break;
case Stream_choice::ALT_choice__list__1:
delete single_value.field_choice__list__1;
default:
break;
}
break;
case VALUE_LIST:
case COMPLEMENTED_LIST:
delete [] value_list.list_value;
default:
break;
}
template_selection = UNINITIALIZED_TEMPLATE;
}

