void Stream_choice_choice__list_0::set_param(Module_Param& param)
{
  if (dynamic_cast<Module_Param_Name*>(param.get_id()) != NULL &&
      param.get_id()->next_name()) {
    char* param_field = param.get_id()->get_current_name();
    if (param_field[0] >= '0' && param_field[0] <= '9') {
      param.error("Unexpected array index in module parameter, expected a valid field"
        " name for union type `@http_etherx_jabber_org_streams.Stream.choice.choice_list.CHOICE'");
    }
    if (strcmp("message_", param_field) == 0) {
      message__().set_param(param);
      return;
    } else if (strcmp("presence", param_field) == 0) {
      presence().set_param(param);
      return;
    } else if (strcmp("iq", param_field) == 0) {
      iq().set_param(param);
      return;
    } else param.error("Field `%s' not found in union type `@http_etherx_jabber_org_streams.Stream.choice.choice_list.CHOICE'", param_field);
  }
  param.basic_check(Module_Param::BC_VALUE, "union value");
  if (param.get_type()==Module_Param::MP_Value_List && param.get_size()==0) return;
  if (param.get_type()!=Module_Param::MP_Assignment_List) {
    param.error("union value with field name was expected");
  }
  Module_Param* mp_last = param.get_elem(param.get_size()-1);
  if (!strcmp(mp_last->get_id()->get_name(), "message_")) {
    message__().set_param(*mp_last);
    return;
  }
  if (!strcmp(mp_last->get_id()->get_name(), "presence")) {
    presence().set_param(*mp_last);
    return;
  }
  if (!strcmp(mp_last->get_id()->get_name(), "iq")) {
    iq().set_param(*mp_last);
    return;
  }
  mp_last->error("Field %s does not exist in type @http_etherx_jabber_org_streams.Stream.choice.choice_list.CHOICE.", mp_last->get_id()->get_name());
}

