case OMIT_VALUE:
return FALSE;
case SPECIFIC_VALUE:
if(!other_value.streamErrorGroup().is_bound()) return FALSE;
if(!single_value->field_streamErrorGroup.match(other_value.streamErrorGroup()))return FALSE;
if(!other_value.text().is_bound()) return FALSE;
if((other_value.text().ispresent() ? !single_value->field_text.match((const urn__ietf__params__xml__ns__xmpp__streams::Text&)other_value.text()) : !single_value->field_text.match_omit()))return FALSE;
